import "./coinlist.css";

export default function Coinlist(props) {
  // const { coinData } = useContext(Context);

  return (
    <>
      <div>Top Tokens by Market Capitalization.</div>
      <div className="coinlist-table-headers">
        <div>Rank</div>
        <div>Name</div>
        <div>Price</div>
        <div>24hr%</div>
        <div>7d%</div>
        {/* <div>Market Cap</div>
        <div>Volume(24hr)</div> */}
        <div>Last 7 Days</div>
      </div>
      {props.coinData?.map((coin) => {
        return <CoinRow coin={coin} />;
      })}
    </>
  );
}
